import { Formik } from "formik";

const FormLogin = () => {
    return (
        <Formik
            onSubmit={handleFormS}
        >
            {
                ({
                    values,
                    errors,
                    touched,
                    handleChange,
                    handleSubmit,
                    setFieldValue,
                    resetForm
                }) => {
                    return (
                        <form onSubmit={handleSubmit}>
                            <input></input>
                        </form>
                    )

                }
            }

        </Formik>
      
    )
}


export default FormLogin
